  render() {
    return (
      <div className='item'>
          <img src={"./img/" + this.props.item.img}></img>
          <h2>{this.props.item.title}</h2>
          <p>{this.props.item.desc}</p>
          <b>{this.props.item.price}$</b>
          <div className='add-to-cart' onc >+</div>
      </div>
    )
  }
}

export default Item
